import React, { Component } from 'react';
import { PieChart, Pie} from 'recharts';
const data01 = 
[{name: 'Page A', uv: 400, pv: 2400, amt: 2400},
{name: 'Page B', uv: 800, pv: 2800, amt: 2900},
{name: 'Page C', uv: 300, pv: 2000, amt: 2100},
{name: 'Page D', uv: 100, pv: 2600, amt: 2200}];

const data02 = 
[
{name: 'Page A', uv: 300, pv: 2000, amt: 2100},
{name: 'Page B', uv: 100, pv: 2600, amt: 2200},
{name: 'Page C', uv: 400, pv: 2400, amt: 2400},
{name: 'Page D', uv: 800, pv: 2800, amt: 2900}];

export default class PieChartWidget extends Component {
    render() {
        
      return ( 
<PieChart width={730} height={250}>
  <Pie data={data01} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={50} fill="#8884d8" />
  <Pie data={data02} dataKey="value" nameKey="name" cx="50%" cy="50%" innerRadius={60} outerRadius={80} fill="#82ca9d" label />
</PieChart>
     );
    }
  }
